import classes from './Header.module.css';

const Header = (props) => {
    const name = '';
    if (props.pageName === 'Home'){
        name = 'My To Do List';
    }
    else {
        name = props.pageName;
    }
    

    // console.log(props.pageName);
    return (
        <div className={classes.header}>
            <span>{name}</span>

        </div>
    )

};

export default Header;
